const ArticaleCard = ({ el }) => {
  return (
    <div>
      <div>
        {console.log("test")}
        <div> {el.title} </div>
        <div>{el.description} </div>
        <div>{el.published} </div>
      </div>
    </div>
  );
};
export default ArticaleCard;
